package Practice_01012025;

public class Swap_numbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

        int a= 10;
        int b=20;
        System.out.println("Initial Value in a = "+a +"\nInitial Value in b = "+b);

        int c = a ;
        System.out.println("initial value in c = "+c);
        a = b;
        System.out.println("value of a after swap a = "+a );

        b=c;
        System.out.println("value of b after swap b = "+b );
        System.out.println("Final value of a ="+a+ "\nFinal Value of b ="+b);


	}

}
